import React, { useState } from "react";
import { FormControl, FormGroup, Input, InputLabel, Typography, Button, styled } from "@mui/material";
import { userLogin } from "../services/api";
import {useNavigate} from 'react-router-dom'

const ContainerStyle = styled(FormGroup)({
	width: "50%",
	margin: "5rem auto",
	"& > div": {
		marginTop: "1.5rem",
	},
});

const LoginPage = () => {
	const [userData, setUserData] = useState("");
    const navigate = useNavigate();
	const handleValueChange = (e) => {
		setUserData({ ...userData, [e.target.name]: e.target.value });
	};

	const handleClick = async () => {
		await userLogin(userData);

        
	};

	return (
		<ContainerStyle>
			<Typography variant="h4" align="center" gutterBottom>
				{" "}
				Login{" "}
			</Typography>

			<FormControl>
				<FormGroup>
					<InputLabel>Email</InputLabel>
					<Input type="email" placeholder="Enter Email" onChange={(e) => handleValueChange(e)} name="email" />
				</FormGroup>
			</FormControl>
			<FormControl>
				<FormGroup>
					<InputLabel>Password</InputLabel>
					<Input type="password" placeholder="Enter Password" onChange={(e) => handleValueChange(e)} name="password" />
				</FormGroup>
			</FormControl>
			<FormControl>
				<Button variant="contained" color="primary" onClick={() => handleClick()}>
					Login
				</Button>
			</FormControl>
		</ContainerStyle>
	);
};

export default LoginPage;
